Actionscript.script:
射击计数 = 0;
性能倍率 = 2;

function 射击()
{
	if((射击计数++ % 性能倍率) != 0)
	{
		return;
	}

	var 子弹属性 = _root.子弹属性初始化(this.攻击点);
	子弹属性.声音 = "fr506.wav";
	子弹属性.霰弹值 = 1;
	子弹属性.子弹散射度 = 14;
	子弹属性.发射效果 = "";
	子弹属性.子弹种类 = "加强普通子弹";
	子弹属性.子弹威力 = 6 * 性能倍率 * _parent.空手攻击力;
	子弹属性.子弹速度 = 36;
	子弹属性.击中地图效果 = "火花";
	子弹属性.Z轴攻击范围 = 30;
	子弹属性.击倒率 = 24;
	子弹属性.击中后子弹的效果 = "";
	子弹属性.子弹敌我属性 = !_parent.是否为敌人;
	_root.子弹区域shoot传递(子弹属性);
}

function 火炮开火()
{
	var 子弹属性 = _root.子弹属性初始化(this.攻击点3);
	子弹属性.声音 = "shoot.wav";
	子弹属性.霰弹值 = 1;
	子弹属性.子弹散射度 = 3;
	子弹属性.发射效果 = "";
	子弹属性.子弹种类 = "火炮炮弹";
	子弹属性.子弹威力 = 15 * _parent.空手攻击力;
	子弹属性.子弹速度 = 68;
	子弹属性.击中地图效果 = "火花";
	子弹属性.Z轴攻击范围 = 30;
	子弹属性.击倒率 = 1;
	子弹属性.击中后子弹的效果 = "";
	子弹属性.子弹敌我属性 = !_parent.是否为敌人;
	_root.子弹区域shoot传递(子弹属性);
}

function 导弹巢()
{
	var 子弹属性 = _root.子弹属性初始化(this.导弹攻击点);
	子弹属性.声音 = "shoot.wav";
	子弹属性.霰弹值 = 1;
	子弹属性.子弹散射度 = 10;
	子弹属性.发射效果 = "";
	子弹属性.子弹种类 = "微型导弹";
	子弹属性.子弹威力 = 10 * _parent.空手攻击力;
	子弹属性.子弹速度 = 18;
	子弹属性.击中地图效果 = "火花";
	子弹属性.Z轴攻击范围 = 30;
	子弹属性.击倒率 = 10;
	子弹属性.击中后子弹的效果 = "";
	子弹属性.子弹敌我属性 = !_parent.是否为敌人;
	_root.子弹区域shoot传递(子弹属性);
}
